import PageBannerV from './pages/BannerV';
import PageBannerX from './pages/BannerX';
import PageBannerZ from './pages/BannerZ';

import PageBannerAA from './pages/BannerAA';
import PageBannerAB from './pages/BannerAB';
import PageBannerAC from './pages/BannerAC';
import PageBannerAD from './pages/BannerAD';
import PageBannerAE from './pages/BannerAE';
import PageBannerAF from './pages/BannerAF';

class Routers extends Component {


    state = {  }

    render() { 
        return (
            <>
                <BrowserRouter>
                    <Switch>
                        <Route exact path="/react/" component={PageDefault} />
                        <Route exact path="/react/404" component={PageNotFound} />

                        {/* banner */}
                        <Route exact path="/react/banner-a" component={PageBannerA} />
                        <Route exact path="/react/banner-b" component={PageBannerB} />
                        <Route exact path="/react/banner-c" component={PageBannerC} />
                        <Route exact path="/react/banner-d" component={PageBannerD} />
                        <Route exact path="/react/banner-e" component={PageBannerE} />
                        <Route exact path="/react/banner-f" component={PageBannerF} />
                        <Route exact path="/react/banner-g" component={PageBannerG} />
                        <Route exact path="/react/banner-h" component={PageBannerH} />
                        <Route exact path="/react/banner-i" component={PageBannerI} />
                        <Route exact path="/react/banner-j" component={PageBannerJ} />
                        <Route exact path="/react/banner-k" component={PageBannerK} />
                        <Route exact path="/react/banner-l" component={PageBannerL} />
                        <Route exact path="/react/banner-m" component={PageBannerM} />/
                        <Route exact path="/react/banner-n" component={PageBannerN} />
                        <Route exact path="/react/banner-o" component={PageBannerO} />
                        <Route exact path="/react/banner-p" component={PageBannerP} />
                        <Route exact path="/react/banner-q" component={PageBannerQ} />
                        <Route exact path="/react/banner-r" component={PageBannerR} />
                        <Route exact path="/react/banner-s" component={PageBannerS} />
                        <Route exact path="/react/banner-t" component={PageBannerT} />
                        <Route exact path="/react/banner-u" component={PageBannerU} />
                        <Route exact path="/react/banner-v" component={PageBannerV} />
                        <Route exact path="/react/banner-x" component={PageBannerX} />
                        <Route exact path="/react/banner-z" component={PageBannerZ} />

                        <Route exact path="/react/banner-aa" component={PageBannerAA} />
                        <Route exact path="/react/banner-ab" component={PageBannerAB} />
                        <Route exact path="/react/banner-ac" component={PageBannerAC} />
                        <Route exact path="/react/banner-ad" component={PageBannerAD} />
                        <Route exact path="/react/banner-ae" component={PageBannerAE} />
                        <Route exact path="/react/banner-af" component={PageBannerAF} />



                    </Switch>
                </BrowserRouter>
            </>
        );
    }
}

export default Routers;
